import Layout from '../components/MyLayout';
import Link from 'next/link'
import fetch from 'isomorphic-unfetch';

const Visitors = props => (
  <Layout>
    <h1>Visitors</h1>
    {props.visitors ? 
    <table class="table">
      <thead>
        <tr>
          <th scope="col">Name</th>
          <th scope="col">E-mail</th>
          <th scope="col">Actions</th>
        </tr>
      </thead>
      <tbody>
          {props.visitors.map(visitor => (
                <tr>
                  <td>
                      <Link href="/visitors/[id]" as={`/visitors/${visitor.vid}`}>
                          <a>{visitor.name}</a>
                      </Link>
                  </td>
                  <td>
                    <a>{visitor.email}</a>
                  </td>
                  <td>
                    <button type="button" class="btn btn-success">View</button>
                    <span/>
                    <button type="button" class="btn btn-danger">Delete</button>
                  </td>
                </tr>
            ))}

      </tbody>
    </table>
    :
      <Alert type="danger" text="No visitor yet!"></Alert>
    }
  </Layout>
);

Visitors.getInitialProps = async function(context) {
  const res = await fetch(`http://localhost:8080/parkpay/visitors`);
  const visitors = await res.json();

  return { visitors };
};

export default Visitors;
